import React, {Component} from 'react';
import {Link} from 'react-router-dom';
import axios from "axios";


class TableRow extends Component {
    constructor(props) {
        super(props);
        this.deletesss = this.deletesss.bind(this);
    }
    deletesss(){
        axios.get('http://localhost:5000/zooInventory/deleteequipment/'+this.props.obj._id)
            .then(this.setState({redirect: true}))
            .catch(err => console.log(err))
        alert("Your Equipment Successfully Deleted....")
        window.location.replace('/viewEquipment');
    }
    render() {
        return (
           <tr>
                <td>
                   {this.props.obj.itemno}
               </td>
               <td>
                   {this.props.obj.date}
               </td>
               <td>
                   {this.props.obj.date}
               </td>
               <td>
                   {this.props.obj.name}
               </td>
               <td>
                   {this.props.obj.qty}
               </td>
               <td>
                   {this.props.obj.lastcheckdate}
               </td>
               <td>
                   {this.props.obj.nextcheckdate}
               </td>
               <td>
                   {this.props.obj.vender}
               </td>
               <td>
                   {this.props.obj.maintaner}
               </td>
               <td>
                   <Link to={"/editEquipment/"+this.props.obj._id} className="btn btn-success">Edit</Link>
                   &nbsp;
                   <button onClick={this.deletesss} className="btn btn-danger">Delete</button>
               </td>
           </tr>
        );
    }
}

export default TableRow;
